import { Home } from './components/pages/Home';

import classNames from 'classnames/bind';
import styles from './components/GlobalStyle/GlobalStyle.module.scss';

const cx = classNames.bind(styles);

function App() {
    return (
        <div className={cx('App')}>
            <Home />
        </div>
    );
}

export default App;
